import './App.css';

function App() {
	const [name , setname] = useState("")

	const Event1 = (event) =>{
		setname(event.target.value)
	}

  return (
    <>
	<div className='app'>
		<div className='main_div'>
			<div className='cent_div'>
				<br/>
				<h2>join a chat</h2>
				<input type='text' placeholder='join...' value={name} onChange={Event1} />
			</div>
		</div>
	</div>
	</>
  );
}

export default App;
